class Solution:
    @staticmethod
    def evaluate(top: int, op: str, bottom: int) -> int:
        if op == '+':
            return bottom + top
        if op == '-':
            return bottom - top

    @staticmethod
    def is_number(c: str) -> bool:
        try:
            int(c)
            return True
        except ValueError:
            return False

    @staticmethod
    def is_operator(c: str) -> bool:
        return c == '+' or c == '-' or c == '('

    def calculate(self, s: str) -> int:
        s = s.replace(" ", "")
        stack = []
        i = 0
        while i < len(s):
            curr = s[i]
            # make sure that we concatenate all numbers
            while self.is_number(s[i]) and i + 1 < len(s) and self.is_number(s[i + 1]):
                curr = curr + s[i + 1]
                i = i + 1

            # begin real operations
            while not self.is_operator(curr) and len(stack) > 0:
                if self.is_number(curr):
                    tos = stack[len(stack) - 1]
                    # if tos is operator
                    if tos == '+' or tos == '-':
                        curr = self.evaluate(int(curr), stack.pop(), int(stack.pop()))
                    else:
                        break
                elif curr == ')':
                    curr = stack.pop()
                    stack.pop()
                else:
                    break

            # add value to the stack
            stack.append(curr)
            i = i + 1

        res = stack.pop()
        print(res)
        return res

